import Footer from "./pages/Footer";
import Counter from "./components/Counter";
import TypingAnimation from "./components/TypingAnimation";



class App extends React.Component {
    render() {
        return (
            <>
                <Nav />
                <About />
                <Skills />
                <Projects />
                <Contact />
                <Footer /> 
                <Counter />

            </>
        );
    }
}
export default App;
